Rules.InvariantScript:
Set(selectedCompanyCode, ThisItem.'Company Code');
Set(selectedSiteAndWarehouse, "");
Set(selectedSite, "");
Set(selectedWarehouse, "");

If(
    IsBlank(selectedCompanyCode),
    Notify("Please select a legal entity"),
    If(
        IsBlank(
            LookUp(
                'Inventory onhand mobile app statuses',
                Onboarded = true
            )
        ),
        Patch(
            'Inventory onhand mobile app statuses',
            {
                'Default company': selectedCompanyCode,
                Onboarded: true
            }
        ),
        Patch(
            'Inventory onhand mobile app statuses',
            First('Inventory onhand mobile app statuses'),
            {
                'Default company': selectedCompanyCode,
                Onboarded: true
            }
        )
    );
    Navigate(ProductSearch)
)
